var body = document.querySelector("#coloring-box");

function create(element, params) {
  var out = document.createElement(element);

  if (element === "svg")
    out = document.createElementNS("http://www.w3.org/2000/svg", params.type);

  if (params["class"]) out.className = params["class"];

  if (params["click"]) out.onclick = params["click"];

  if (params["mouseover"]) out.onmouseover = params["mouseover"];

  if (params["html"]) out.innerHTML = params["html"];

  if (params["text"]) out.innerText = params["text"];

  if (params["eventListener"])
    out.addEventListener(
      params["eventListener"].name,
      params["eventListener"]["action"]
    );

  if (params["data"]) {
    Object.keys(params["data"]).map(function (key) {
      out.dataset[key] = params["data"][key];
    });
  }

  if (params["attr"]) {
    Object.keys(params["attr"]).map(function (key) {
      out.setAttribute(key, params["attr"][key]);
    });
  }

  if (params["style"]) {
    Object.keys(params["style"]).map(function (key) {
      out.style[key] = params["style"][key];
    });
  }

  return out;
}

function addClass(element, param) {
  function hasClass(classes, cls) {
    return (" " + classes + " ").indexOf(" " + cls + " ") > -1;
  }

  if (!hasClass(element.className, param)) element.className += " " + param;
}

function removeClass(element, param) {
  function hasClass(classes, cls) {
    return (" " + classes + " ").indexOf(" " + cls + " ") > -1;
  }

  if (hasClass(element.className, param))
    element.className = element.className.replace(" " + param, "");
}

function parsePx(param) {
  return parseInt(param.substr(0, param.length - 2));
}

var app = {
  menu: true,
  activeImage: 1,
};

var notify = {
  isOpen: false,

  open: function (style, text) {
    addClass(this.modal, "open");

    this.context.className = "dialog " + style;

    this.isOpen = true;

    var icons = {
      info: "info",
      success: "check",
    };

    if (style === "clear") {
      this.context.innerHTML = text;
    } else {
      this.context.innerHTML =
        '<span class="icon"><i class="material material-' +
        icons[style] +
        '"></i></span><span class="text">' +
        text +
        "</span>";
    }
  },

  close: function () {
    removeClass(this.modal, "open");

    this.isOpen = false;
  },

  init: function () {
    var _this = this;

    this.modal = create("div", {class: "notyfy"});
    this.context = create("div", {
      class: "dialog",
      click: function () {
        _this.close();
      },
    });

    this.modal.appendChild(this.context);
    body.appendChild(this.modal);
  },
};

