var layout = {
  dragging: false,

  mouse: [0, 0],

  scale: 10,

  position: [0, 0],

  // move: function (x, y) {
  //   var pos = {
  //     x: this.position[0] - (this.mouse[0] - x),
  //     y: this.position[1] - (this.mouse[1] - y),
  //   };

  //   this.context.style.left = pos.x + "px";
  //   this.context.style.top = pos.y + "px";
  // },

  // zoom: function (delta) {
  //   this.scale -= (delta / 10) * 0.1;
  //   this.context.style.transform = "scale(" + this.scale * 0.1 + ")";
  // },

  coloring: function (element) {
    if (
      Math.round(parsePx(this.context.style.left)) ===
      Math.round(this.position[0])
    ) {
      if (
        element.getAttribute("fill") ===
        colors[palette.activeColor[0]].colors[palette.activeColor[1]]
      ) {
        element.setAttribute("fill", "#fff");
      } else {
        element.setAttribute(
          "fill",
          colors[palette.activeColor[0]].colors[palette.activeColor[1]]
        );
      }
    }
  },

  clear: function () {
    var svgElements = this.context.children;

    for (var i = 0; i < svgElements.length; i++) {
      svgElements[i].setAttribute("fill", "#fff");
    }
  },

  init: function () {
    var _this = this,
      image = images[app.activeImage];

    this.context = create("svg", {
      type: "svg",
      style: {
        fill: "#fff",
        stroke: "#000",
        strokeOpacity: 0.1,

        width: window.innerWidth * 0.8,
        height: window.innerHeight * 0.6,
        left: window.innerWidth / 2 - image.width / 2,
        top: window.innerHeight / 2 - image.height / 2,
      },
      attr: {
        xmlns: "http://www.w3.org/2000/svg",
        viewBox: "-30 0 " + 360 + " " + 360,

        id: "coloring-svg",
      },
      eventListener: {
        name: "mousedown",
        action: function (e) {
          _this.dragging = true;
          _this.mouse = [e.clientX, e.clientY];
          _this.position = [
            parsePx(_this.context.style.left),
            parsePx(_this.context.style.top),
          ];
        },
      },
    });

    image.data.map(function (path) {
      var newElement = create("svg", {
        type: path.type,
        style: {
          transition: "0.25s",
        },
        click: function () {
          var clicked = this;

          if (colorize.active) {
            colors.map(function (set, setI) {
              set.colors.map(function (color, colorI) {
                if (color === clicked.getAttribute("fill"))
                  palette.activeColor = [setI, colorI];
              });
            });

            palette.update();

            colorize.active = false;
            colorize.fix();
          } else {
            _this.coloring(this);
          }
        },
        mouseover: function () {
          if (colorize.active)
            colorize.bg.style.background = this.getAttribute("fill");
        },
      });

      Object.keys(path).map(function (key) {
        newElement.setAttribute(key, path[key]);
      });

      _this.context.appendChild(newElement);
    });

    this.position = [
      parsePx(this.context.style.left),
      parsePx(this.context.style.top),
    ];

    body.appendChild(this.context);
  },
};

var palette = {
  elements: [],

  activeColor: [0, 0],

  close: function () {
    addClass(this.context, "closed");
  },

  open: function () {
    removeClass(this.context, "closed");
  },

  update: function () {
    var _this = this;

    this.elements.map(function (item, i) {
      item.className = "item color";
      item.style.backgroundColor = colors[_this.activeColor[0]].colors[i];

      if (parseInt(_this.activeColor[1]) === i) item.className += " active";
    });
  },

  init: function () {
    var _this = this;

    this.context = create("section", {
      class: "palette",
      click: function () {
        if (palettes.isOpen) {
          palettes.isOpen = false;

          _this.open();
          palettes.close();
        }
      },
    });

    for (var i = 0; i < 5; i++) {
      var color = create("span", {
        class: "item color",
        style: {
          backgroundColor: colors[_this.activeColor[0]].colors[i],
        },
        data: {
          index: i,
        },
        click: function () {
          _this.activeColor[1] = this.dataset.index;

          palette.update();

          colorize.active = false;
          colorize.fix();
        },
      });

      if (parseInt(_this.activeColor[1]) === i) color.className += " active";

      this.elements.push(color);
      _this.context.appendChild(color);
    }

    body.appendChild(this.context);
  },
};

var colorize = {
  bg: [],

  active: false,

  move: function (x, y) {
    this.context.style.position = "fixed";
    this.context.style.pointerEvents = "none";
    this.context.style.transition = "all 0s, font-size 0.3s";
    this.context.style.top = y - 15 + "px";
    this.context.style.left = x + 6 + "px";
    this.context.style.fontSize = "0";
  },

  fix: function () {
    this.context.setAttribute("style", "");
  },

  init: function () {
    var _this = this;

    this.context = nav.button("colorize");
    this.bg = this.context.children[0].children[0];

    this.context.onclick = function () {
      _this.active = true;

      palette.activeColor[1] = -1;
      palette.update();
    };
  },
};

var palettes = {
  page: 0,

  isOpen: false,

  move: function (x, y) {
    var pos = {
      x: this.position[0] - (this.mouse[0] - x),
      y: this.position[1] - (this.mouse[1] - y),
    };

    this.svg.style.left = pos.x + "px";
    this.svg.style.top = pos.y + "px";
  },

  close: function () {
    removeClass(this.modal, "open");

    this.isOpen = false;

    palette.open();
  },

  open: function () {
    addClass(this.modal, "open");

    this.isOpen = true;
  },

  init: function () {
    var _this = this;

    this.modal = create("div", {class: "coloring-menu"});
    this.context = create("div", {class: "dialog"});

    var row = create("div", {class: "row"});

    colors.map(function (set, i) {
      var col = create("div", {class: "col"}),
        title = create("span", {class: "title", text: colors[i].name}),
        setItem = create("div", {
          class: "palette closed",
          data: {
            colorId: i,
          },
          click: function () {
            palette.activeColor = [this.dataset.colorId, 0];
            palette.update();

            _this.close();
          },
        });

      colors[i].colors.map(function (color, colorI) {
        var colorItem = create("span", {
          class: "item color",
          style: {
            backgroundColor: colors[i].colors[colorI],
          },
        });

        setItem.appendChild(colorItem);
        col.appendChild(setItem);
      });

      col.appendChild(title);
      row.appendChild(col);

      _this.context.appendChild(row);
    });

    this.modal.appendChild(this.context);
    body.appendChild(this.modal);

    colorize.init();
  },
};

var fullsceen = {
  active: false,

  toggle: function () {
    if (this.active) {
      this.close();
    } else {
      this.open();
    }
  },

  open: function () {
    addClass(nav.context, "fullscreen");
    addClass(palette.context, "fullscreen");

    this.active = true;
  },

  close: function () {
    removeClass(nav.context, "fullscreen");
    removeClass(palette.context, "fullscreen");

    this.active = false;
  },
};

